import React from 'react';

function Card({data}) {
    return (
        <>
        <li className='notepad-infos'>
            <div>
                <strong>Clientes: {data.customers_total}</strong>
            </div>
            <textarea>{data.city}</textarea>
        </li>
        </>
    )
}

export default Card;
